export const createR = (RForm)=>{
    return {
 
        "reservations": [
            {
                "id": RForm.id,
                "user": {
                    "name": RForm.name
                },
                "number_people": RForm.number_people,
                "date": {
                    "name": RForm.name
                },
                "hour": {
                    "name": RForm.name
                }
            }
        ]



    }
    }
